import Typed from 'typed.js';

export default {
  init() {
    new Typed('.typed', {
      strings: window.servicesOffered,
      typeSpeed: 25,
      backSpeed: 25,
      backDelay: 0,
      startDelay: 50,
      loop: true,
      showCursor: false,
    });

    const $slides = $('[data-js-slide ]');

    if ($slides.length) {
      let slideIndex = 0;
      setInterval(() => {
        $slides.removeClass('active');
        if (slideIndex === $slides.length - 1) {
          slideIndex = 0;
        } else {
          slideIndex++;
        }
        $slides.eq(slideIndex).addClass('active');

      }, 3000);
    }
  },
};
